import requests
import html2text
import os
import re
from requests.exceptions import RequestException

# Ensure there's a directory to store the files
output_dir = "Extracted_Articles"
os.makedirs(output_dir, exist_ok=True)

def extract_specific_part_from_text(text, start_marker, end_marker):
    start_index = text.find(start_marker)
    end_index = text.find(end_marker, start_marker) + len(end_marker)
    if start_index != -1 and end_index != -1:
        return text[start_index:end_index]
    return "Content not found."

def extract_text_from_url(url, timeout=10, max_retries=3):
    for _ in range(max_retries):
        try:
            response = requests.get(url, timeout=timeout)
            response.raise_for_status()  # Raise an error for bad responses (4xx, 5xx)
            full_text = html2text.html2text(response.text)
            return full_text
        except RequestException as e:
            print(f"Retrying {url} due to error: {e}")
    raise Exception(f"Failed to fetch {url} after {max_retries} retries")

def sanitize_filename(filename, max_length=50):
    # Replace invalid characters with an underscore and truncate the filename
    sanitized = re.sub(r'[<>:"/\\|?*]', '_', filename)
    return sanitized[:max_length]

