for source, details in sources.items():
    base_url = details["base_url"]
    article_partial_urls = details["article_partial_urls"]

    for idx, partial_url in enumerate(article_partial_urls, start=1):
        if base_url:
            full_url = base_url + partial_url
        else:
            full_url = partial_url
        print(f"Extracting content from: {full_url}")
        try:
            article_text = extract_text_from_url(full_url)
            # Extract article ID from URL for filename
            article_id = partial_url.split('=')[-1] if base_url else full_url.split('/')[-1]
            sanitized_article_id = sanitize_filename(article_id)
            file_path = os.path.join(output_dir, f"{source}_article_{idx:03}_{sanitized_article_id}.txt")

            with open(file_path, 'w', encoding='utf-8') as file:
                file.write(article_text)

            print(f"Content saved to {file_path}")
            print("\n---\n")
        except Exception as e:
            failed_urls.append((idx, full_url, str(e)))
            print(f"Failed to extract content from {full_url}. Error: {e}")
            print("\n---\n")

# Print the list of failed URLs with their numbers
if failed_urls:
    print("\nFailed URL extraction attempts:\n")
    for fail in failed_urls:
        print(f"Number: {fail[0]}")
        print(f"URL: {fail[1]}")
        print(f"Error: {fail[2]}")
        print("\n---\n")